import { Methods, request } from '@/libs/request'
import { ROUTER } from '@/router'

export type postCreateTeahouseFilterType = {
  category: string;
  title: string;
  show: boolean;
  priority: number;
}

const { TEAHOUSE } = ROUTER

export const postCreateTeahouseFilter = async({ category, title, show, priority }: postCreateTeahouseFilterType) => {
  return request<{ id: number }>({
    url: `${TEAHOUSE}/admin/filter`,
    method: Methods.POST,
    data: { category, title, show, priority }
  })
}
